上市公司华数传媒控股股份有限公司拥有上百万小时的数字媒体内容库、数千万台互联网电视终端，新媒体全业务运营牌照。', 'http://tech.sina.com.cn/i/2014-04-08/18199305530.shtml', '63', '1');INSERT INTO `hhs_weixin_keywords` ( `id`, `name`, `keyword`, `type`, `contents`, `pic`, `pic_tit`, `desc`, `pic_url`, `count`, `status` ) VALUES  ('105', '文本消息测试', '文本消息', '1', '近年来，公开选拔和竞争上岗作为干部人事制度改革的重要举措，在拓宽选人视野，打破论资排辈等不少方面积极作用明显。“但走向极端就会出现问题，比如一些地方规定公开选拔和竞争上岗人员必须达到干部任用的多少比例，甚至进一步绝对化为‘凡提必竞’。”中央党校教授辛鸣说。', '', '', '', '', '54', '1');INSERT INTO `hhs_weixin_lang` ( `lang_id`, `lang_name`, `lang_value` ) VALUES  ('1', 'regmsg', '极拼商城是社群经济+精准推送+拼团模式于一体的新兴购物平台，以经营高品质进口商品为主。\r\n极拼商城的商家都是经过严格审核的、资质齐全的公司商家，所选商品都是在保证质量前提下给出的最优价格，极拼团员们可以买到真正适合您的低价正品。');INSERT INTO `hhs_weixin_menu` ( `cat_id`, `cat_name`, `cat_type`, `keywords`, `weixin_key`, `links`, `sort_order`, `weixin_type`, `parent_id` ) VALUES  ('59', '极拼商城', '1', '', '', 'http://www.1jipin.com/index.php', '1', '1', '0');INSERT INTO `hhs_weixin_menu` ( `cat_id`, `cat_name`, `cat_type`, `keywords`, `weixin_key`, `links`, `sort_order`, `weixin_type`, `parent_id` ) VALUES  ('60', '商城须知', '1', '', '', '', '10', '0', '0');INSERT INTO `hhs_weixin_menu` ( `cat_id`, `cat_name`, `cat_type`, `keywords`, `weixin_key`, `links`, `sort_order`, `weixin_type`, `parent_id` ) VALUES  ('61', '我的团购', '1', '', '', 'http://www.1jipin.com/user.php?act=team_list', '20', '1', '58');INSERT INTO `hhs_weixin_menu` ( `cat_id`, `cat_name`, `cat_type`, `keywords`, `weixin_key`, `links`, `sort_order`, `weixin_type`, `parent_id` ) VALUES  ('58', '团员之家', '1', '', '', '', '5', '0', '0');INSERT INTO `hhs_weixin_menu` ( `cat_id`, `cat_name`, `cat_type`, `keywords`, `weixin_key`, `links`, `sort_order`, `weixin_type`, `parent_id` ) VALUES  ('62', '我的订单', '1', '', '', 'http://www.1jipin.com/user.php?act=order_list', '10', '1', '58');INSERT INTO `hhs_weixin_menu` ( `cat_id`, `cat_name`, `cat_type`, `keywords`, `weixin_key`, `links`, `sort_order`, `weixin_type`, `parent_id` ) VALUES  ('63', '个人中心', '1', '', '', 'http://www.1j